  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The SWAN Coordinating Center provides
  SWAN data access to SWAN Investigators through the study website.  The SWAN website
  provides access to longitudinal data describing the physical, biological, psychological,
  and social changes that occur during the menopausal transition. Data collected from
  3,302 SWAN participants from Baseline through the 13th Follow-Up visit are currently
  available.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
